import axios from 'axios';
 
 class ScheduleService {
 
 delete(id) {
 axios.get('http://localhost:8070/timetable/delete/' + id)
 .then(() => {
 console.log('Deleted !!!')
 })
 .catch((error) => {
 console.log(error)
 })
 }
 }
 
 export default ScheduleService;
